import { useState } from "react";

function Count() {
    <div>
    const [count, setCount] = useState(1)
    function incrementValue (){
        setCount(count + 1)
      
    }
    function decrementValue () {
        setCount(count - 1)
    }
  </div>
  return(
    <>
      <span>{count}</span>
      <br></br>
      <button onClick = {decrementValue}>bawasan mo</button>
      <button onClick = {incrementValue}>dag-dagan mo</button>
      
    </>
  );
}
export default Count;
